import {Doughnut} from "react-chartjs-2"

const data = {
    labels: ["Red", "Blue", "Green", "Yellow","Orange"],
    datasets: [{
        data: [20,2,6,43,67],
        backgroundColor: [
            "red",
            "Blue",
            "Green",
            "Yellow",
            "Orange",
        ],
        borderwidth: 1,
    }],
};

function DoughnutChart(){

    return (
        <div>
            <Doughnut data={data} />
        </div>
    )
}

export default DoughnutChart;
